import React from 'react'
import 'container/certificate.css'
function Certificate() {
  return (
    <div>
               <select >
                 <option value='option1'>Certificate Genarate</option>
                 <option value='option2'>Certificate Download</option>
               </select>
    </div>
  )
}

export default Certificate
